INSERT INTO `mobile_settings` (`id`, `logo_fathschool`, `description_apps`, `features_apps`, `advantages_apps`, `conclusion_apps`, `fathforce_phone_number`, `fathforce_browser_link`, `fathforce_email`, `logo_fathforce`, `logo_school`, `google_play_link_student`, `google_play_link_teacher`, `production_version_student`, `production_version_teacher`, `app_version_student`, `app_version_teacher`, `created_at`, `updated_at`) VALUES
(1, 'logo.png', 'FathSchool adalah sistem informasi terintegrasi untuk manajemen sekolah yang efisien dan efektif.', '1. Manajemen Siswa: Pendaftaran online, database siswa, dan pencatatan kehadiran dengan notifikasi otomatis.\r\n2. Manajemen Guru dan Staf: Penyimpanan data, jadwal mengajar real-time, dan evaluasi kinerja.\r\n3. Manajemen Akademik: Pengelolaan kurikulum, penilaian online, dan platform e-learning.\r\n4. Manajemen Keuangan: Sistem pembayaran terintegrasi, pembukuan otomatis, dan manajemen dana bantuan.\r\n5. Komunikasi dan Informasi: Portal orang tua, notifikasi, dan forum diskusi.\r\n6. Fasilitas Pendukung: Perpustakaan digital, manajemen asrama, dan pengelolaan ekstrakurikuler.', '- Terintegrasi dan mudah diakses \r\n- Keamanan data yang ketat \r\n- Antarmuka user-friendly \r\n- Dukungan teknis responsif', 'FathSchool adalah solusi manajemen sekolah yang meningkatkan efisiensi operasional, komunikasi, dan pengalaman belajar siswa.', '6285161721727', 'https://fathforce.com/', 'hi@fathforce.com', 'logo.png', 'logo.png', 'https://youtu.be/l_Ml95MB72E?si=S7hR7SUe054xYNYu', 'https://youtu.be/l_Ml95MB72E?si=S7hR7SUe054xYNYu', 'Alpha', 'Alpha', '1.0.0', '1.0.0', '2024-08-05 07:27:25', '2024-08-08 08:18:02');
